import React, {useState} from 'react';
import PhotoAlbum from "react-photo-album";
import sunny from '../images/fanart/sunny.png';
import { fanartPhotos } from './Photos';
import { welcomestyle } from '../styles/homestyles';

export default function Fanart (){

  return (
      <div>
        <div><h1 styles={welcomestyle}>fan art</h1></div>
        <PhotoAlbum layout="columns" columns='2' spacing='20' photos={fanartPhotos} />
      </div>
  )
}
